// ==UserScript==
// @name	Ajoute des bouttons pour scroll en Haut ou en Bas d'une page
// @author	Wilou
// @description	Aller en haut ou en bas de page
// @version     2.1
// @include	*
// @icon data:image/jpeg;base64,
// @namespace https://greasyfork.org/fr/users/11667-aymeric-maitre
// @grant none
// ==/UserScript==
(function () {
  function addEvent(obj, event, fn) {
    return obj.addEventListener ? obj.addEventListener(event, fn, false)  : obj.attachEventListener('on' + event, fn);
  };
  function getScrollHeight() {
    return document.body ? bodyScrollHeight = document.body.scrollHeight : document.documentElement.scrollHeight;
  };
  function getClientHeight() {
    return document.documentElement ? document.documentElement.clientHeight : document.body.clientHeight;
  };
  function hasScroll() {
    return getScrollHeight() > getClientHeight() ? true : false;
  };
  function $(id) {
    return document.getElementById(id);
  }
  function getStyle(obj, attr) {
    return obj.currentStyle ? obj.currentStyle[attr] : getComputedStyle(obj) [attr];
  }
  function getScrollTop() {
    return document.documentElement.scrollTop ? document.documentElement.scrollTop : document.body.scrollTop;
  }
  function getClientHeight() {
    return document.documentElement ? document.documentElement.clientHeight : document.body.clientHeight;
  }
  function createElement(tagName, idName, styleList, appendPosition, endFn) {
    var newElement = document.createElement(tagName);
    newElement.id = idName;
    newElement.style.cssText = styleList;
    appendPosition && appendPosition.appendChild(newElement);
    endFn && endFn();
  }
  function doMove(obj, attr, dir, target, endFn) {
    dir = parseInt(getStyle(obj, attr)) < target ? dir : - dir;
    clearInterval(obj.timer);
    obj.timer = setInterval(function () {
      var speed = parseInt(getStyle(obj, attr)) + dir;
      if (speed > target && dir > 0 || speed < target && dir < 0) {
        speed = target;
      };
      obj.style[attr] = speed + 'px';
      if (speed == target) {
        clearInterval(obj.timer);
        endFn && endFn();
      };
    }, 30);
  };
  function movein() {
    clearTimeout($('scrollMars-troy').timerHover);
    doMove($('scrollMars-troy'), 'right', 10, 5, function () {
      doMove($('scrollMars-troy'), 'width', 20, 100);
    });
  };
  function moveout() {
    clearTimeout($('scrollMars-troy').timerHover);
    $('scrollMars-troy').timerHover = setTimeout(function () {
      doMove($('scrollMars-troy'), 'right', 10, - 80, function () {
        doMove($('scrollMars-troy'), 'width', 20, 160);
      });
    }, 3000);
  };
  function scrollTop() {
    clearInterval($('goTop-troy').timerScroll);
    $('goTop-troy').timerScroll = setInterval(function () {
      var speed = (getScrollTop() / 5) + 10;
      position = getScrollTop() - speed;
      if (position <= 0) {
        document.body.scrollTop = document.documentElement.scrollTop = 0;
        clearInterval($('goTop-troy').timerScroll);
        $('goTop-troy').timerScroll = null;
      }
      document.body.scrollTop = document.documentElement.scrollTop = position;
    }, 20);
  };
  function scrollBtn() {
    clearInterval($('goTop-troy').timerScroll);
    $('goTop-troy').timerScroll = setInterval(function () {
      var speed = (getScrollTop() / 5) + 10;
      position = getScrollTop() + speed;
      if (position + getClientHeight() >= getScrollHeight()) {
        document.body.scrollTop = document.documentElement.scrollTop = getScrollHeight();
        clearInterval($('goTop-troy').timerScroll);
        $('goTop-troy').timerScroll = null;
      }
      document.body.scrollTop = document.documentElement.scrollTop = position;
    }, 20);
  };
  function createBtn() {
    if ($('scrollMars-troy') && hasScroll() == true) {
      $('scrollMars-troy').style.top = (getClientHeight() / 3) + 'px';
    } else if ($('scrollMars-troy') && hasScroll() == false) {
      $('scrollMars-troy').remove($('scrollMars-troy'));
    };
    if (hasScroll() == false && !$('scrollMars-troy')) {
      return false;
    } else if (hasScroll() == true && !$('scrollMars-troy')) {
      createElement('div', 'scrollMars-troy', MarsCSS, window.top.document.documentElement);
      $('scrollMars-troy').innerHTML = '<div id=\'goTop-troy\' class=\'Top-and-Btn\'></div><div id=\'goBtn-troy\' class=\'Top-and-Btn\'></div>';
      $('scrollMars-troy').style.top = (getClientHeight() / 3) + 'px';
      $('goTop-troy').style.cssText = BottonCSS;
      $('goBtn-troy').style.cssText = BottonCSS;
      $('goTop-troy').innerHTML = '↑';
      $('goBtn-troy').innerHTML = '↓';
      addEvent($('goTop-troy'), 'click', function () {
        scrollTop()
      });
      addEvent($('goBtn-troy'), 'click', function () {
        scrollBtn()
      });
      addEvent(window, 'resize', function () {
        $('scrollMars-troy').style.top = (getClientHeight() / 3) + 'px';
      });
      addEvent($('scrollMars-troy'), 'mouseover', function () {
        movein()
      });
      addEvent($('scrollMars-troy'), 'mouseout', function () {
        moveout()
      });
      addEvent($('goTop-troy'), 'mouseover', function () {
        $('goTop-troy').style.background = '#004BFF';
      });
      addEvent($('goTop-troy'), 'mouseout', function () {
        $('goTop-troy').style.background = '#303030';
      });
      addEvent($('goBtn-troy'), 'mouseover', function () {
        $('goBtn-troy').style.background = '#004BFF';
      });
      addEvent($('goBtn-troy'), 'mouseout', function () {
        $('goBtn-troy').style.background = '#303030';
      });
      moveout();
    };
  };
  var MarsCSS = '\t\t\twidth:100px;\t\t\theight:120px;\t\t\tposition:fixed;\t\t\tright:5px;\t\t\tz-index:99999;\t\t'
  var BottonCSS = '\t\t\twidth:40px;\t\t\theight:20px;\t\t\tbox-sizing: content-box;\t\t\ttext-align:center;\t\t\tpadding:5px;\t\t\tmargin:5px auto;\t\t\tbackground:#303030;\t\t\tcolor:#fff;\t\t\tdisplay:block;\t\t\topacity:0.8;\t\t\tfitter:alpha(opacity:80);\t\t\tcursor:pointer;\t\t\tborder-radius:40%;\t\t\tbox-shadow:2px 2px 10px 2px #303030;\t\t\tfont-size:16px;\t\t\tfont-family:"Open Sans";\t\t\tz-index:9999;\t\t'
  addEvent(window.top, 'load', function () {
    createBtn()
  });
  addEvent(window.top, 'resize', function () {
    createBtn()
  });
}) ()
